class TWDict:
  '''Thin wrapper around CMUDict data. http://www.speech.cs.cmu.edu/cgi-bin/cmudict'''
  def __init__(self, file_or_path, keep_ambiguous=True):
    if isinstance(file_or_path, str):
      with open(file_or_path, encoding='latin-1') as f:
        entries = _parse_twdict(f)
    else:
      entries = _parse_twdict(file_or_path)
    if not keep_ambiguous:
      entries = {word: pron for word, pron in entries.items() if len(pron) == 1}
    self._entries = entries


  def __len__(self):
    return len(self._entries)


  def lookup(self, word):
    '''Returns list of ARPAbet pronunciations of the given word.'''
    return self._entries.get(word.upper())



_alt_re = re.compile(r'\([0-9]+\)')


def _parse_twdict(file):
  twdict = {}
  for line in file:
#    if len(line) and (line[0] >= 'A' and line[0] <= 'Z' or line[0] == "'"):
    if len(line):
#      parts = line.split('  ')
      parts = line.split(' ')
#      word = re.sub(_alt_re, '', parts[0])
      word = parts[0]
      pronunciation = _get_tw_pronunciation(parts[1])
      if pronunciation:
        if word in twdict:
          twdict[word].append(pronunciation)
        else:
          twdict[word] = [pronunciation]
  return twdict


def _get_tw_pronunciation(s):
  parts = s.strip().split(' ')
  for part in parts:
    if part not in _valid_symbol_set:
      return None
  return ' '.join(parts)
